import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import SuccessInfo from './successInfo';
import ShowCities from './city';

export default function UVoiceCard() {
  return (
    <React.Fragment>
      <CssBaseline />
      <Container fixed>
        <Box sx={{ bgcolor: '#cfe8fc', height: '50vh', margin: '40vh', width: '80vh', }} >
          <SuccessInfo />
        </Box>
      </Container>
    </React.Fragment>
  );
}
